import Header from './Header'
import Footer from './Footer'

function App() {
  return (
    <div className="App">
      <Header />
      <div className="content">
        <p>Data pulled from <a href="https://ergast.com/mrd/">https://openf1.org</a></p>
      </div>
      <Footer />
    </div>
  );
}

export default App;
